import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'
const exclusive = (props) => (
    <div>
        <Head>
            <style amp-custom>
                {`
                .container_exclusive_banner {
                    background-color: #52bdae;
                    display: block;
                    font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                }

                .right_teal{
                    display:flex;
                }
                .left_teal{
                    display:block;
                }
                .teal_banner_line1{

                    padding-left:13%;
                    padding-top: 4%;
                    margin:auto;
                    font-size: 18px;
                    display:block;
                    color:white;
                }
                .teal_banner_line2{
                    padding-top:10px;   
                    padding-left:45%;
                    padding-bottom:2%;
                    margin:auto;
                    color:white;
                    font-size: 18px;
                    display:block;
                    font-size: 18px;
                }
                .teal_banner_line3{
                    font-size:1.7em;
                    padding-left:12%;
                    margin:auto;
                    display:block;
                    font-weight: bold;
                    color:white;
                }
                .addtocart_cardone{
                    background-color: white;
                    margin-left:30px;
                    margin-bottom:10px;

                }
                .addtocart_cardtwo{
                    background-color: white;
                    margin-left:10px;
                    margin-right:30px;
                    margin-bottom:10px;
                }
                .upper{
                    background-color:#e7e6e6 ;
                    margin-top:0px;
                    text-align: center;
                    font-weight: bold;
                    margin-bottom:0px;
                    color: #58595f;
                    padding: 10px 20px 0px 20px;
                    letter-spacing: 2px;
                }
                .permonth{
                    color:black;
                    text-align: center;
                    font-size: 12px;
                    color: #58595f;
                    font-weight: bold;
                    letter-spacing: 1px;
                }
                .instant_access{
                    color:black;
                    text-align: center;
                    font-size: 12px;
                    color: #58595f;
                    font-weight: bold;
                    letter-spacing: 1px;
                }
                .price{
                    background-color:#e7e6e6 ;
                    margin-top:0px;
                    text-align: center;
                    font-weight: bold;
                    margin-bottom:0px;
                    color: #58595f;
                    padding: 5px 20px 5px 10px;
                    letter-spacing: 2px;
                }
                .addtocart_button{
                    background-color:#ed3833;
                    color: white;
                    padding:8px;
                    display: block;
                    margin:auto;
                    margin-top:10px;
                    margin-bottom:10px;
                    border-radius: 6px;
                }
                .brackets_shit{
                    display:block;
                    margin:auto;
                    padding-left:15px;
                    font-size:13px;
                    margin-top:30px;
                    color:white;
                    margin-bottom:10px;

                }
                .container_3buttons{
                    display:flex;
                }
                .grey_bg{
                    background-color:#e7e6e6;
                    display:flex;
                    margin-top:10px;
                }
                .3buttons{
                    display:block;

                 }
                 .benefits{
                    color: #58595f;
                    display:block;
                    margin:auto;
                    margin-top:10px;
                 }
                 .price_comp{
                    color: #58595f;
                 }
                 .faqs{
                    color: #58595f;
                 }
                `}

            </style>
        </Head>
        <body>
            <div class="container_exclusive_banner">
                <div class="left_teal" >
                    <p>
                        <p class="teal_banner_line1"> BECOME AN EXCLUSIVE MEMBER </p>
                        <p class="teal_banner_line2"> AT AN </p>
                        <p class="teal_banner_line3"> INTRODUCTORY PRICE </p> 
                        <p class="brackets_shit">(Adding membership to cart will unlock Exclusive prices instantly)</p>

                    </p>
                </div>
                <div class="right_teal">
                    <div class="addtocart_cardone">
                            <p class="upper"> MONTHLY </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 149/- per month</p>
                            <p class="instant_access">Get instant access 
                                for a full month.</p>
                            <h3 class="price">@ Rs. 149/-</h3>  
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                    <div class="addtocart_cardtwo">
                            <p class="upper"> ANNUAL </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 25/- per month</p>
                            <p class="instant_access">Get instant access 
                                for a full year.</p>
                            <h3 class="price">@ Rs. 299/-</h3>   
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                </div>   
                </div>    
            <div class="container_3buttons">
                <div class="grey_bg">
                    <div class="3buttons">
                            <p class="benefits"> BENEFITS </p>
                    </div>
                    <div class="3buttons">
                            <p class="price_comp"> PRICE COMPARISON </p>
                    </div>
                    <div class="3buttons">
                            <p class="faqs"> FAQS </p>
                    </div>
                </div>
            </div>    
        </body>
    </div>


)

export default withAmp(exclusive , {hybrid:true})
